import React from 'react';
import ReactDOM from 'react-dom';

const users = ["Mohan","Ramesh","Suresh","Dinesh"];
ReactDOM.render(
    React.createElement('ul',null,
        React.createElement( users.map(users => `<li>${users.name}</li>`).join(' ')),


    ), 
    document.getElementById('root'));
